Dick-Tation (1992) [DVDRip]

Ron Jeremy is well-cast here as a lecherous office manager who gets sex from his lady employees in return for not his hiring them. But Randy Spears is miscast as Ronnie's partner in slime. He just doesn't naturally project that quality which comes so offhandedly to Ron - a walking slimeball. The girls of the office, Danielle Rogers, Holly Ryder and Cameo, get their revenge in a scene that is very reminiscent of a 1981 classic - 8 To 4. My personal starlet of the year, Sunny McKay, has a no-lines scene with Don Fernando in which she turns what could have been ho-hum into a humdinger. What a difference a smile can make. But that is the only item of note. The other four scenes all fall into the average category.

